import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);

const store = new Vuex.Store({
  state: {
    Bin:[]
  },
  mutations: {
    AddValues(state, newValue) {
      state.Bin.push(newValue);
    }
  }
});

export default store;
